import React from 'react';
import { Text, View, TextInput,TouchableOpacity } from 'react-native';

export default class StoryScreen extends React.Component {
    render() {
      return (
        <View style={{ flex: 1, justifyContent: 'center', alignItems: 'center' }}>
          <Text>Write Your Story Here</Text>

          <Text>Story's name</Text>
          <TextInput style={{width:90, height:20,borderWidth:2,}}/>
          <Text>Author</Text>
          <TextInput style={{width:90, height:20,borderWidth:2,}}/>
          <Text>Story</Text>
          <TextInput style={{width:1000, height:500,borderWidth:2,}}/>

          <TouchableOpacity><Text>Submit</Text></TouchableOpacity>
        </View>
      );
    }
  }
